import './App.css';

import 'bootstrap/dist/css/bootstrap.min.css';
// import { Counter } from './Components/Counter';
// import { DynamicContent } from './Components/DynamicContent';
//import Parent from './Components/Parent';
//import ReturnComp from './Components/ReturnComp';
// import ToggleContent from './Components/ToggleCont';
//import BasicExample from './Components/Badges';
import  ShapeExample from './Components/Team';
import Button from 'react-bootstrap/Button';
import CardsEmp from './Components/CardsEmp'
import { Row } from 'react-bootstrap';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
//import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
//import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';


function App() {
  return (
    <div className="App">
      <header>
      <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="#">Navbar scroll</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Nav.Link href="#action1">Home</Nav.Link>
            <Nav.Link href="#action2">Link</Nav.Link>
            <NavDropdown title="Link" id="navbarScrollingDropdown">
              <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action4">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action5">
                Something else here
              </NavDropdown.Item>
            </NavDropdown>
            <Nav.Link href="#" disabled>
              Link
            </Nav.Link>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
      </header>
      <main>
      <Button variant="primary" className="mt-5 border bg-primary-subtle border-primary rounded-pill text-primary fw-bold">TEAM</Button>
      <Container className="mt-5 ">
        <h2>Our Hardworking <span className="text-primary">Team</span></h2>
      <p className='mt-3'>Lorem met cursus sit amet dictum. Platea dictumst quisque sagittis purus. Arcu dictum varius duis at. Bibendum at varius vel pharetra vel turpis nunc. Sed elementum tempus egestas sed sed risus. Vitae turpis massa sed elementum tempus. Tortor at risus viverra adipiscing at in tellus integer. </p>
      </Container>

      < ShapeExample/> 
      <Container >
        <Row>

        </Row>
      </Container>

      </main>
    </div>
  );
}

export default App;
